import { Button, ListGroup } from "reactstrap";
import { Link } from "react-scroll";
import "bootstrap/dist/css/bootstrap.min.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const Menu = () => {
  return (
    <div>
      <div className="sidenav text-xs ">
        <li className="active text-sm">
          <Link
            className="cursor-pointer nav-link text-blue-50"
            activeClass="active"
            to="intro"
            spy={true}
            smooth={true}
            offset={-60}
            duration={50}
            isDynamic={true}
          >
            <FontAwesomeIcon icon="fa fa-l" />
            Home
          </Link>
        </li>
        {/* <div className="divider"></div> */}
        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="projects"
            spy={true}
            smooth={true}
            offset={-14}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Projects
          </Link>
        </li>
        {/* <div className="divider"></div> */}
        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="skills"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            <i class="me-2 fa fa-light fa fa-house"></i>
            Skills
          </Link>
        </li>
        {/* <div className="divider"></div> */}
        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="exp"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Experience
          </Link>
        </li>
        {/* <div className="divider"></div> */}
        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="contact"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Contact
          </Link>
        </li>
      </div>
    </div>
  );
};
export default Menu;
